import MainNav from "./MainNav";
import Body from "./Body";

const Index = (props) => {
  const [posts, setPosts] = useState([]);

//   useEffect(() => () {

//   });

  return (
    <div>
      <MainNav />
      <Body posts={posts}/>
    </div>
  );
};

export default Index;
